export default function App() {
  return (
    <>
      <div id="navdiv">
        <div className="flexnav">home</div>
        <div className="flexnav">about</div>
        <div className="flexnav">contect</div>
        <div className="flexnav">servces</div>
      </div>
    </>
  );
}
